import React from 'react'
import { Link } from 'react-router-dom'
import { Navbar, Nav } from 'react-bootstrap-v5';

const Navbarleft = () => {
  return (
    <Navbar bg="dark" variant="dark">
      <Nav className="mr-auto">
      <li><Link to="/" > Product </Link></li>
        <Nav.Link as={Link} to="/Home">Home</Nav.Link>
        <Nav.Link as={Link} to="/allproject">Project Listing</Nav.Link>
        <Nav.Link as={Link} to="/createproject">Add Project</Nav.Link>
      </Nav>
      {/* Add any additional components like login/logout buttons if needed */}
    </Navbar>
  )
}

export default Navbarleft
